import logo from './logo.svg';
import { Welcome } from "./components/findmusictogether"
import './App.css';
import './testingcollapse';

function App({ age }) {
  return (
    <div className="App">
      <Welcome name="mr steven" age={9 * 2}/>
      <SomeText />
      <MoreText />
      <MoreText />
    </div>
  );
}

function SomeText() {
  return <p>Steven so cool!</p>
}

function MoreText() {
  return <p>your mother</p>
}

export default App;
